INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (1, 'Lumânări multifuncționale', 'Lumânare reutilizabilă cu destinații multiple: bisericească, pentru aniversări, anală, vaginală, etc.', 1, 1, '3', 'https://static.independent.co.uk/s3fs-public/thumbnails/image/2019/01/17/11/istock-994807816.jpg?w968h681');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (2, 'Nafură Multivitamin', 'Nafură proaspătă cu varză și bostan afumat. Conține numeroase substranțe active și aminoacizi. A se utiliza înainte de sală.', 2, null, '5', 'http://ortodoxia.me/wp-content/uploads/2017/05/anafura.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (3, 'Colivă clasică', 'Fabricată conform rețetei clasice din sec. XII. Procesul de sfințenie incrementează puritatea acesteia de 10 ori, deci se recomandă a nu se consuma nesfințită.', 2, null, '47', 'https://media.realitatea.net/multimedia/image/201802/w460/reteta-coliva-modele-ornat-1_93520400.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (4, 'Choker puritan "Svastica creștină"', 'Choker personalizat cu aură anti-vampir, cu puterea de 200 de usturoi (concentrație dublă de sfințenie)', 3, null, '568', 'https://blogulcudoigalbeni.files.wordpress.com/2011/05/cruce-de-manelist1.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (5, 'Iconițe parfumate Autocar', 'Iconițe odorizante decorative de atașat sub oglindă în rutieră, Kamaz sau Tractor. Sunt disponibile o gamă largă de arome cu efect psihologic evlavios.', 3, null, '50', 'https://media2.lajumate.ro/media/i/new_details/3/357/3574293_icoane-bizantine-si-realiste-litografiate-vitralii-cruci_1.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (6, 'Porție de Împărtășanie ', 'Porție de împărtășanie 0,13 ml(1 lingură de vin Cagor cu nafură de mâna a doua) porția zilnică de imunitate spirituală.', 2, null, '22', 'https://doxologia.ro/sites/default/files/styles/media-articol-colorbox/public/articol/2016/02/sfanta_impartasanie.jpg?itok=1km0hfpu');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (7, 'Aghiazmă potabilă angro', 'Cantități inepuizabile de aghiazmă suprasfințită pentru depozitare în caz de zombi-apocalypse (Doamne ferește).', 2, null, '15', 'https://www.universulargesean.ro/wp-content/uploads/2015/01/images_ziar_2015_ianuarie_bobo.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (8, 'Vin sfințit la borcan', 'Vin fără nafură pentru aniversări, corporative, onomastice. Provoacă conexiuni sprituale dense între coechipierii de pahar, stabilind o undă comună unică.', 2, null, '43', 'http://www.canal2.md/media/2015/04/vin-500x364.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (9, 'Piercing Cruce sfințită', 'Cruce metalică de 4 stele, unisex. Sfințită la mănăstirea Curchi, este antivirusul perfect împotriva soacrelor, țiganilor și poliției rutiere.', 3, null, '35', 'https://www.askideas.com/media/78/Custom-Industrial-Piercing-With-Cross.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (10, 'Nafură prospătă Franzeluța', 'Set complet de 666 de nafure de la Franzeluța. Purificarea matinală e mai gustoasă datorită noii rețete cu gem papal de post.', 2, null, '3', 'http://www.ganduridinierusalim.com/wp-content/uploads/2017/11/anafura-in.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (11, 'Coșniță cadou cu 13 seturi de nafură', 'Cadoul perfect pentru bunici de Revelion, Paști sau Hram. Include 13 seturi variate de nafură delicioasă din toate cele 4 colțuri ale lumii, inclusiv faimoasa nafură "Pirojocul lui Moise", rețeta căreia a fost desecretizată recent, după mai bine de 666 de ani de liturgii intensive.  ', 2, null, '21', 'https://str.crestin-ortodox.ro/foto/1447/144697_pasti.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (12, 'Nafură Sedativă', 'Nafură sedativă pentru păstrarea neprihanirii în postul mare. Concepută pentru păcătoșii impulsivi ispitiți de mirosul de șașlîc de la vecini, etc. ', 2, null, '4.5', 'http://ortodoxia.rol.ro/images/aghiasma-anafura-ulei.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (13, 'Colivă Țărănească Express', 'Colivă tradiţională țărănească congelată pentru cazuri extreme. Este gata cît ai spune "Aleluia", astfel încât pregatirea pentru slujbă are loc instantaneu.', 2, null, '53.5', 'https://retete.unica.ro/wp-content/uploads/2018/01/Desert_Coliva_800x53.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (14, 'Coliva "Mătii"', 'Asortiment larg de colive de aruncat în față la zile de naștere, parastase, etc. Pe lîngă efectele sale miraculoase de hidratare și catifelare a pielii, mai formează un câmp energetic pios - barieră pentru potențialele spirite necurate ce pot afecta sărbătoarea.', 2, null, '41', 'http://ideisanatoase.ro/wp-content/uploads/2018/02/coliva-din-arpacas-cu-nuca-reteta-cum-se-face1.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (15, 'Colivă "Cornetto"', 'Mini-colivă cornișor de dat de pomană la înmormîntări. Se recomandă a se consuma c-un pahar de vin de sufletu răpostaului.', 2, null, '12', 'https://4.bp.blogspot.com/-mhpc8_b0WbE/WjR4jxw3K8I/AAAAAAAAJy8/oN8ma09mkJMXWA5QrO1lfrxhrvmk4txJgCLcBGAs/s1600/pahare%2Bcu%2Bcoliva.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (16, 'Colivă Abjorka Premium', 'Colivă de toate zilele. Nesfințită, cu garnitură de cașă mannaya, este alimentul ideal pentru păcătoșii obsedați de colivă în perioadele dintre slujbe.', 2, null, '20', 'https://img.dollo.ro/2010/08/coliva4.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (17, 'Cruce Celtică "Extra-Sens"', 'Cruce făcătoare de minuni cu proprietăți isoterice deosebit de puternice. A se utiliza pentru ritualuri de echilibrare a destinului (vezi filmul "Constantine"). Atenție! Utilizarea neregulamentară (ex: generarea blestemelor) provoacă trecerea ireversibilă a sufletului de Partea întunecată a Forţei.', 3, null, '1028', 'https://images.okr.ro/serve/auctions.v7/2017/feb/27/bf1076857c5b8cdacfa689253a7f225a-8533266-400_400.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (18, 'Cruce-Brățară "Antideochi"', 'Acest echipament se poate elibera fără prescripţie mănăstirească. Se recomandă citirea cu atenţie a descîntecului. Dacă apar manifestări neplăcute, adresaţi-vă călugărului sau mitropolitului.', 3, null, '481', 'https://cdn.janette.ro/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/i/n/inel-argint-statement-cruce-janette-min.jpg');
INSERT INTO ig2En2jVO1.holy_products (id, name, description, type_id, manufacturer_id, price, image_url) VALUES (19, 'Cruce pentru copii "Ferească Prăpădul"', 'Cruciuliță sfîntă cu aură contra prăpădului - ține odrasla departe de mreajele necuratului. Excesul de sare, zahăr şi grăsimi dăunează grav sănătăţii', 3, null, '214', 'https://www.orgoni.ro/wp-content/uploads/2019/02/Cruce-orgonica-Crystal-cu-inelus.jpg');
